import React, { useState } from 'react'
import { NavLink } from "react-router-dom"
import { Registrar } from "./Registrar"
import { Listar } from "./Listar"
import { Estadistica } from "./Estadistica"
import Logo from '../assets/img/geeksmart.jpg';

export const Menu = (props) => {

  const [reg, setReg] = useState("");
  const [lis, setLis] = useState("");
  const [est, setEst] = useState("");
 
  

  function cerrarSesion(){
    document.getElementById("caja_menu").style.display = "none";
    document.getElementById("form_login").style.display = "block";
    document.getElementById("txtusu").value = "";
    document.getElementById("txtpas").value = "";
    document.getElementById("txtusu").focus();
  }


  function op_registrar(){
    setReg("1");
    setLis("0");
    setEst("0");
  }


  function op_listar(){
    setReg("0");
    setLis("1");
    setEst("0");
  }


  function op_estadistica(){
    setReg("0");
    setLis("0");
    setEst("1");
  }



  return (
    
    
    <>
     <nav className="">
                        <ul>
                          
                            


                            <li>
                                <a className="" href="#"> <NavLink to="" className=""   onClick={ op_registrar } > <span className="ml-4">Registrar</span></NavLink>


                                          </a>
                                      </li>




                            <li>
                                <a className="" href="#"> <NavLink to="" className=""   onClick={ op_estadistica } > <span className="ml-4">Dashboard</span></NavLink>


                                          </a>
                                      </li>




                            <li>

                       

                      <a className="" href="#"> <NavLink to="" className=""  o onClick={ op_registrar } > <span className="ml-4">Precio</span></NavLink>
    
   
                              </a>
                          </li>

                   





                            <li>


                                <a className="" href="#"> <NavLink to="" className=""  onClick={ op_listar } > <span className="ml-4">Clientes</span></NavLink>
                                    
                                   
                                </a>
                            </li>
                           
                        </ul>
                        <p className=" ">Servicio</p>
                        <ul>
                            <li>
                                <a  white=""  href="#">
                                   
                                    <span className="ml-4"> telefono</span>
                                </a>
                            </li>
                            <li>
                                <a  white="" href="#">
                                   
                                    <span className="ml-4"> pc</span>
                                </a>
                            </li>

                            <li>
                                <a className="" white="" href="#">
                                   
                                    <span className="ml-4"> otros</span>
                                </a>
                            </li>



                            <li>
                                <a className="" href="#">
                                    
                                    <span className="ml-4">configuracion</span></a>
                            </li>
                            <li>
                                <a className="i" white=""  href=" "  onClick={ cerrarSesion } >
                                   
                                    <span className="ml-4">Cerrar Seccion</span>


                                    


                                </a>
                            </li>




                            
                        </ul>
                    </nav>

    
        
        <h1 className="text-lg text-neutral-600"> { reg === "1" && <Registrar/> }
  { lis === "1" && <Listar/>}
  { est === "1" && <Estadistica/> }</h1>
            <div className="py-6">

           
               
                
            </div>
        
   

  

       
 

</>
  



  )
}
